Create Database Robokent

Create Table uye_bilgii(
id int primary key identity (1,1),
kullanici_adi nvarchar(50),
sifre nvarchar(50),
ad_soyad nvarchar(50),
telefon_no nvarchar(11))

Create Table adminler(
admin_id int primary key identity(1,1),
admin_adi nvarchar(50),
admin_sifre nvarchar(50))


Create Table urun_bilgii(
urun_id int primary key identity(1,1),
urun_adi nvarchar(100),
urun_kategori nvarchar(100),
urun_stok nvarchar(20),
urun_fiyat nvarchar(20))


Create Table kredi_kartii(
kart_id int primary key identity (1,1),
kart_no nvarchar(17),
kart_cvv nvarchar(3),
kart_date nvarchar(6))




CREATE TABLE siparis(
siparis_id int primary key identity (1,1),
siprasi_adres nvarchar(1000),
siparis_ekbilgi nvarchar(500))






CREATE TABLE   credit_cards (
	id int primary key identity(1,1),
	card_number VARCHAR(19) NOT NULL,
	expiration_month VARCHAR(2) NOT NULL,
	expiration_year VARCHAR(4) NOT NULL,
	cvv VARCHAR(4) NOT NULL,
);
